import React, { Component } from 'react';
// import PropTypes from 'prop-types';

class AuthForm extends Component {
    constructor(props) {
        super(props);
        this.state = {
            email: '',
            username: '',
            password: ''
        }
    }

    render() {
        const { email, username, password } = this.state;
    }
}

export default AuthForm;
